INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (8, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "東山奈央", 16, 27, "人助けが大好き！　前向き格闘娘", 44, "ヒヨリ", "人助け、応援", 0, "トゥインクルウィッシュ", 2, "A", "獣人族", 100101, 155);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (4, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "種田梨沙", 17, 5, "戦闘のサポートが得意な、心優しい少女", 47, "ユイ", "料理、人間観察", 0, "トゥインクルウィッシュ", 2, "O", "ヒューマン", 100201, 158);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (1, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", "早見沙織", 18, 12, "クールで何事にも真っ直ぐな剣士", 46, "レイ", "読書、乗馬、お茶", 0, "トゥインクルウィッシュ", 2, "B", "魔族", 100301, 163);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (8, "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", "諸星すみれ", 9, 10, "探検好きのイタズラっ子", 27, "ミソギ", "いたずら、探検", 0, "リトルリリカル", 5, "O", "ヒューマン", 100401, 128);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (11, "？？？", "下田麻美", 12, 25, "ヒーローに憧れる騎士見習いの少女", 40, "マツリ", "ヒーローごっこ", 0, "王宮騎士団（NIGHTMARE）", 8, "O", "獣人族", 100501, 146);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (11, "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", "浅倉杏美", 13, 22, "甘え上手なみんなの人気者", 42, "アカリ", "サックス", 0, "悪魔偽王国軍（ディアボロス）", 7, "O", "魔族", 100601, 150);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (1, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", "雨宮天", 14, 23, "プリン大好きゴースト娘", 32, "ミヤコ", "プリンを食べること", 0, "悪魔偽王国軍（ディアボロス）", 7, "B", "魔族", 100701, 130);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (10, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", "大空直美", 14, 10, "ボクは誰よりも美しい", 40, "ユキ", "鏡で自分を見ること", 0, "ヴァイスフリューゲル　ランドソル支部", 15, "AB", "エルフ", 100801, 150);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (7, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", "髙野麻美", 17, 5, "前世を信じる中二病患者、「疾風の冥姫」", 45, "アンナ", "小説執筆", 0, "トワイライトキャラバン", 13, "A", "魔族", 100901, 159);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (9, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", "内田真礼", 16, 22, "マホマホ王国のプリンセス", 42, "マホ", "空想、ぬいぐるみ集め", 0, "自警団（カォン）", 10, "O", "獣人族", 101001, 155);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (8, "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", "阿澄佳奈", 15, 25, "人懐っこくてマシンガントークな妹系少女", 44, "リノ", "お裁縫", 0, "ラビリンス", 3, "A", "ヒューマン", 101101, 156);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (12, "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", "大橋彩香", 17, 24, "みんなのために超能力を使う眠り姫", 46, "ハツネ", "妹と遊ぶこと、二度寝、昼寝、早寝", 0, "フォレスティエ", 6, "A", "エルフ", 101201, 156);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (8, "", "佳村はるか", 18, 21, "オタク全開な魔法少女", 55, "ナナカ", "読書、魔法", 0, "トワイライトキャラバン", 13, "O", "魔族", 101301, 166);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (11, "test", "水瀬いのり", 15, 3, "頭脳明晰な美少女名探偵", 41, "カスミ", "読書、推理", 0, "自警団（カォン）", 10, "AB", "獣人族", 101401, 152);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (9, "test", "國府田マリ子", 21, 5, "母性溢れる優しいみんなの「ミサト先生」", 54, "ミサト", "絵本作り", 0, "フォレスティエ", 6, "O", "エルフ", 101501, 165);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (4, "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", "上坂すみれ", 18, 10, "天真爛漫で人気者のカリスマモデル", 48, "スズナ", "ファッション", 0, "ルーセント学院", 14, "O", "魔族", 101601, 167);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (7, "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", "高森奈津美", 19, 7, "いつでも「なんくるないさ～」な天然娘", 53, "カオリ", "踊り、空手", 0, "自警団（カォン）", 10, "A", "獣人族", 101701, 158);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (8, "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", "伊藤静", 23, 14, "多くの男性を魅了する無垢な女教師", 52, "イオ", "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", 0, "ルーセント学院", 14, "B", "魔族", 101801, 162);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (4, "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", "日高里菜", 10, 3, "お歌もにんじんも、ウサギさんも大好き♪", 21, "ミミ", "かわいいもの集め", 0, "リトルリリカル", 5, "O", "獣人族", 102001, 117);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (6, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "植田佳奈", 12, 9, "泣き虫で臆病な守ってあげたい女の子", 40, "クルミ", "観劇、おままごと", 0, "サレンディア救護院", 9, "B", "ヒューマン", 102101, 150);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (11, "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", "原紗友里", 13, 22, "人見知りであまのじゃくな女の子", 40, "ヨリ", "ゲーム全般", 0, "悪魔偽王国軍（ディアボロス）", 7, "O", "魔族", 102201, 150);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (5, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", "芹澤優", 14, 10, "ぷうきちといつも一緒！", 38, "アヤネ", "屋内でできる遊び", 0, "サレンディア救護院", 9, "B", "ヒューマン", 102301, 148);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (12, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", "悠木碧", 15, 12, "お嬢さまのためにがんばるドジっ娘メイド", 43, "スズメ", "ご奉仕", 0, "サレンディア救護院", 9, "O", "ヒューマン", 102501, 154);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (1, "test", "小岩井ことり", 17, 1, "遊びと睡眠が何より大事なぐうたら娘", 42, "リン", "あんパン", 0, "牧場（エリザベスパーク）", 11, "B", "獣人族", 102601, 144);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (7, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "橋本ちなみ", 16, 30, "運命の相手に一途すぎる乙女", 43, "エリコ", "実験、裁縫、料理", 0, "トワイライトキャラバン", 13, "B", "魔族", 102701, 154);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (10, "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", "堀江由衣", 17, 4, "救護院を経営する優しい庶民派お嬢様", 43, "サレン", "経営、お茶会", 0, "サレンディア救護院", 9, "A", "エルフ", 102801, 156);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (1, "いつか世界中の人達をファンにしてみせる！\nトップアイドルになるその日まで、\n応援よろしくね♪", "日笠陽子", 17, 24, "歌って踊れる大人気アイドル", 40, "ノゾミ", "舞台鑑賞、ダンス", 0, "カルミナ", 4, "B", "ヒューマン", 102901, 157);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (8, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", "佐藤聡美", 16, 31, "トーゴクの神秘、オシエテクダサイ！", 51, "ニノン", "忍法開発", 0, "ヴァイスフリューゲル　ランドソル支部", 15, "O", "ヒューマン", 103001, 163);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (12, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", "大坪由佳", 18, 22, "占いが得意な霊能少女", 42, "シノブ", "占い", 0, "悪魔偽王国軍（ディアボロス）", 7, "AB", "魔族", 103101, 157);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (3, "この私とともにいる限り、\nお金に不自由はさせませんわ！", "松嵜麗", 18, 12, "一人前の商人を目指すパワフルお嬢様", 45, "アキノ", "慈善事業", 0, "メルクリウス財団", 12, "AB", "ヒューマン", 103201, 157);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (3, "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", "新田恵海", 20, 3, "みんなを笑顔にするお笑い牧場主", 35, "マヒル", "漫才", 0, "牧場（エリザベスパーク）", 11, "B", "ヒューマン", 103301, 142);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (3, "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", "今井麻美", 22, 16, "純情でほっとけない大人の女性", 55, "ユカリ", "ウインドーショッピング", 0, "メルクリウス財団", 12, "A", "エルフ", 103401, 164);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (2, "test", "小倉唯", 8, 2, "礼儀正しくしっかり者のちびっ子優等生", 21, "キョウカ", "お勉強", 0, "リトルリリカル", 5, "A", "エルフ", 103601, 118);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (8, "test", "茅原実里", 13, 11, "義理堅くてからかい好きな剣術少女", 43, "トモ", "剣術、年長者をからかう", 0, "王宮騎士団（NIGHTMARE）", 8, "A", "ヒューマン", 103701, 149);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (11, "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…", "小清水亜美", 14, 3, "読書が趣味の病弱少女", 40, "シオリ", "読書、お散歩", 0, "牧場（エリザベスパーク）", 11, "A", "獣人族", 103801, 153);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (6, "友達ができるその日まで…\nBB団で\nトレーニングですっ！", "花澤香菜", 13, 6, "「友達」に憧れる、エルフの森の女の子", 44, "アオイ", "友達作りのイメトレ", 0, "フォレスティエ", 6, "AB", "エルフ", 104001, 158);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (6, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "福原綾香", 17, 3, "人々を守るために歌う、唱喚士の少女", 46, "チカ", "各種楽器", 0, "カルミナ", 4, "O", "ヒューマン", 104201, 163);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (8, "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", "小松未可子", 17, 9, "男勝りで情に厚いワイルド娘", 54, "マコト", "お菓子作り", 0, "自警団（カォン）", 10, "O", "獣人族", 104301, 168);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (5, "test", "丹下桜", "??", 5, "かつては夜を支配した最強の吸血鬼", 50, "イリヤ", "世界征服", 0, "悪魔偽王国軍（ディアボロス）", 7, "A", "魔族", 104401, 172);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (11, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", "長妻樹里", 18, 19, "妄想大好き！　ほんとは照れ屋な女の子", 49, "クウカ", "小説を読むこと", 0, "ヴァイスフリューゲル　ランドソル支部", 15, "AB", "ヒューマン", 104501, 157);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (3, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", "沼倉愛美", 18, 1, "弱きを助け強きをくじく猫娘", 48, "タマキ", "猫とたわむれること", 0, "メルクリウス財団", 12, "AB", "獣人族", 104601, 158);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (10, "？？？", "川澄綾子", 25, 25, "素顔を見せない冷静沈着な女性騎士", 50, "ジュン", "格闘技、湯浴み", 0, "王宮騎士団（NIGHTMARE）", 8, "A", "ヒューマン", 104701, 171);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (11, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", "田所あずさ", 20, 11, "仕事も私事も効率優先な傭兵少女", 49, "ミフユ", "傭兵などのアルバイト", 0, "メルクリウス財団", 12, "O", "ヒューマン", 104801, 163);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (10, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", "生天目仁美", 18, 24, "お姉ちゃんがお世話してあげるからねっ！", 54, "シズル", "家事全般", 0, "ラビリンス", 3, "O", "ヒューマン", 104901, 168);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (1, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", "久野美咲", 11, 3, "ちょっとおませな恋に恋する女の子", 22, "ミサキ", "ファッション誌鑑賞、コスメ集め", 0, "ルーセント学院", 14, "A", "魔族", 105001, 120);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (3, "私は科学者だけど、\n医者の真似事もしてるの\n病気になったら診てあげるわ", "三石琴乃", 27, 7, "実験が趣味の危険な科学者", 53, "ミツキ", "研究、実験", 0, "トワイライトキャラバン", 13, "A", "ヒューマン", 105101, 166);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (3, "私、ごく普通の、どこにでもいる女の子よ！\nみ、見た目以外はね…", "徳井青空", 18, 14, "乙女チックなもふもふアニマル", 100, "リマ", "毛繕い、お喋り", 0, "牧場（エリザベスパーク）", 11, "A", "獣人族", 105201, 150);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (7, "「白き翼」こと、ヴァイスフリューゲル…\nその名に恥じぬよう、天高く舞い、\n華麗に敵を倒してみせる！", "辻あゆみ", 18, 28, "見た目も中身もお子ちゃまな異国の軍人", 33, "モニカ", "お菓子屋通い", 0, "ヴァイスフリューゲル　ランドソル支部", 15, "A", "ヒューマン", 105301, 140);
