INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (12, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", "悠木碧", 15, 12, "お嬢さまのためにがんばるドジっ娘メイド", 43, "スズメ（サマー）", "ご奉仕", 0, "サレンディア救護院", 9, "O", "ヒューマン", 107701, 154);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (9, "なに、モタモタしてんのよ\n仕方ないから、あたしが手伝ってあげるわ\nいい？　感謝しなさいよね！", "立花理香", 14, 2, "行き倒れの謎のネコミミ魔法使い", 39, "キャル（サマー）", "猫と遊ぶ", 0, "美食殿", 1, "A", "獣人族", 107801, 152);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (3, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", "沼倉愛美", 18, 1, "弱きを助け強きをくじく猫娘", 48, "タマキ（サマー）", "猫とたわむれること", 0, "メルクリウス財団", 12, "AB", "獣人族", 107901, 158);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (11, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", "田所あずさ", 20, 11, "仕事も私事も効率優先な傭兵少女", 49, "ミフユ（サマー）", "傭兵などのアルバイト", 0, "メルクリウス財団", 12, "O", "ヒューマン", 108001, 163);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (12, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", "大坪由佳", 18, 22, "占いが得意な霊能少女", 42, "シノブ（ハロウィン）", "占い", 0, "悪魔偽王国軍（ディアボロス）", 7, "AB", "魔族", 108101, 157);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (1, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", "雨宮天", 14, 23, "プリン大好きゴースト娘", 32, "ミヤコ（ハロウィン）", "プリンを食べること", 0, "悪魔偽王国軍（ディアボロス）", 7, "B", "魔族", 108201, 130);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (1, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", "久野美咲", 11, 3, "ちょっとおませな恋に恋する女の子", 22, "ミサキ（ハロウィン）", "ファッション誌鑑賞、コスメ集め", 0, "ルーセント学院", 14, "A", "魔族", 108301, 120);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (6, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "福原綾香", 17, 3, "人々を守るために歌う、唱喚士の少女", 46, "チカ（クリスマス）", "各種楽器", 0, "カルミナ", 4, "O", "ヒューマン", 108401, 163);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (6, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "植田佳奈", 12, 9, "泣き虫で臆病な守ってあげたい女の子", 40, "クルミ（クリスマス）", "観劇、おままごと", 0, "サレンディア救護院", 9, "B", "ヒューマン", 108501, 150);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (5, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", "芹澤優", 14, 10, "ぷうきちといつも一緒！", 38, "アヤネ（クリスマス）", "屋内でできる遊び", 0, "サレンディア救護院", 9, "B", "ヒューマン", 108601, 148);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (8, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "東山奈央", 16, 27, "人助けが大好き！　前向き格闘娘", 44, "ヒヨリ（ニューイヤー）", "人助け、応援", 0, "トゥインクルウィッシュ", 2, "A", "獣人族", 108701, 155);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (4, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "種田梨沙", 17, 5, "戦闘のサポートが得意な、心優しい少女", 47, "ユイ（ニューイヤー）", "料理、人間観察", 0, "トゥインクルウィッシュ", 2, "O", "ヒューマン", 108801, 158);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (1, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", "早見沙織", 18, 12, "クールで何事にも真っ直ぐな剣士", 46, "レイ（ニューイヤー）", "読書、乗馬、お茶", 0, "トゥインクルウィッシュ", 2, "B", "魔族", 108901, 163);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (7, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "橋本ちなみ", 16, 30, "運命の相手に一途すぎる乙女", 43, "エリコ（バレンタイン）", "実験、裁縫、料理", 0, "トワイライトキャラバン", 13, "B", "魔族", 109001, 154);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (10, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", "生天目仁美", 18, 24, "お姉ちゃんがお世話してあげるからねっ！", 54, "シズル（バレンタイン）", "家事全般", 0, "ラビリンス", 3, "O", "ヒューマン", 109101, 168);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (12, "私はアン！一応、マナリア王国の\n第一王女だけど…あまりかしこまらないで、\n気軽に仲良くしてくれたら嬉しいな！", "日笠陽子", 17, 1, "英霊と契約を結んだマナリアの天才王女", 55, "アン", "読書", 0, "？？？", "", "AB", "ヒューマン", 109201, 156);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (2, "ルゥはルゥですぅ！マナリア魔法学院に\n通ってるですぅ。あなたもルゥの\nお友だちになってくれるですか？", "こやまきみこ", 15, 4, "マナリア魔法学院の新入生", 45, "ルゥ", "食べること、眠ること", 0, "？？？", "", "O", "ヒューマン", 109301, 144);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (11, "私はグレア。竜と人、両方の血を\n受け継いでいるの…\nえっと…よ、よろしくね", "福原綾香", 17, 3, "人を超越した力を有す心優しい竜姫", 67, "グレア", "ピアノ", 0, "？？？", "", "B", "半人半竜", 109401, 167);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (11, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", "長妻樹里", 18, 19, "妄想大好き！　ほんとは照れ屋な女の子", 49, "クウカ（オーエド）", "小説を読むこと", 0, "ヴァイスフリューゲル　ランドソル支部", 15, "AB", "ヒューマン", 109501, 157);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (8, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", "佐藤聡美", 16, 31, "トーゴクの神秘、オシエテクダサイ！", 51, "ニノン（オーエド）", "忍法開発", 0, "ヴァイスフリューゲル　ランドソル支部", 15, "O", "ヒューマン", 109601, 163);
