INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (11, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", "田所あずさ", 20, 11, "仕事も私事も効率優先な傭兵少女", 49, "ミフユ（作業服）", "傭兵などのアルバイト", 0, "メルクリウス財団", 12, "O", "ヒューマン", 116901, 163);
