INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (3, "私は科学者だけど、\n医者の真似事もしてるの\n病気になったら診てあげるわ", "三石琴乃", 27, 7, "実験が趣味の危険な科学者", 53, "ミツキ（オーエド）", "研究、実験", 0, "トワイライトキャラバン", 13, "A", "ヒューマン", 117501, 166);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (10, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", "大空直美", 14, 10, "ボクは誰よりも美しい", 40, "ユキ（オーエド）", "鏡で自分を見ること", 0, "ヴァイスフリューゲル　ランドソル支部", 15, "AB", "エルフ", 117601, 150);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (7, "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", "高森奈津美", 19, 7, "いつでも「なんくるないさ～」な天然娘", 53, "カオリ（ハロウィン）", "踊り、空手", 0, "自警団（カォン）", 10, "A", "獣人族", 117701, 158);
INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (8, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", "佐藤聡美", 16, 31, "トーゴクの神秘、オシエテクダサイ！", 51, "ニノン（ハロウィン）", "忍法開発", 0, "ヴァイスフリューゲル　ランドソル支部", 15, "O", "ヒューマン", 117801, 163);
