INSERT INTO `v1_5b0568432b613d1512e5194cba0e280831b456f1a3b6d0e416629cc44a5fa423` VALUES (7, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", "髙野麻美", 17, 5, "前世を信じる中二病患者、「疾風の冥姫」", 45, "アンナ（パイレーツ）", "小説執筆", 0, "トワイライトキャラバン", 13, "A", "魔族", 121901, 159);
